import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

// SEO Pages
import India from './Pages/services/SEO/India'

function App() {
  return (
    <BrowserRouter>
      <Routes>

      {/* seo services */}
        <Route path='/services/seo-services-india' element={<India/>}></Route>
      </Routes>

    </BrowserRouter>
  );
}

export default App;
